const sumAll = function(num1, num2) {
 
        let sum = 0;
      
        // Step 3: Loop through the numbers
        for (let i = num1; i <= num2; i++) {
          // Step 3 (cont.): Add the current number to the sum
          sum += i;
        }
      
        // Step 4: Return the sum
        return sum;
      };
      
  


// Do not edit below this line
module.exports = sumAll;
